public class Normalization {

  public static void main(String[] args) {
    System.out.println("Hello, World");
  }

  public void booleanRename() {
    boolean henk = false;
  }

  public void floatRename() {
    float henk = 13.37;
  }

  public void charRename() {
    char henk = 'h';
  }

  public void stringRename() {
    String henk = "henk";
  }
}
